import React from "react"

class TimeKeeper extends React.Component {
  componentDidMount() {}
  componentDidUpdate() {
    setTimeout(function () {
      console.log("Hello")
    }, 1000)
  }
  render() {
    return
  }
}

export default TimeKeeper
